(317, 'Institut Seni Budaya Indonesia Aceh', NULL, 'isbiaceh@gmail.com', 'https://www.isbiaceh.ac.id', 'Jalan Nuri No.1, Jantho Makmur, Kota Jantho, Kabupaten Aceh Besar, Aceh 23951', '065192023', 'ISBI Aceh merupakan salah satu Perguruan Tinggi Negeri Seni Budaya yang diresmikan oleh Presiden Republik Indonesia Dr. H. Susilo Bambang Yudhoyono pada tanggal 6 Oktober 2014. Saat ini ISBI Aceh memiliki lahan 30 Ha di Kota Jantho, yang nantinya akan dibangun kampus terpadu. ISBI Aceh memiliki 2 fakultas yaitu Fakultas Seni Pertunjukan (FSP) dan Fakultas Seni Rupa dan Desain (FSRD).', '2021-06-17 01:22:07', '2021-06-17 01:22:07'),
(318, 'Universitas Jabal Ghafur', 2, 'unigha@unigha.ac.id', 'https://www.unigha.ac.id', 'Jalan Gle Gapui, Kecamatan Indra Jaya, Kabupaten Pidie, Provinsi Aceh', '065324610', 'Terletak di Jalan Gle Gapui Aceh, universitas yang didirikan pada 1982 ini dinaungi oleh Yayasan Kampus Jabal Ghafur. Konon, pendiri Universitas Jabal Ghafur adalah seorang putra asli Aceh bernama Nurdin Abdurrahman (almarhum) yang menjadi rektor pertama di universitas ini. Tahun demi tahun Universitas Jabal Ghafur terus berbenah untuk mempersiapkan generasi muda yang berakhlak mulia dan bertanggung jawab. Kampus ini bisa menjadi pilihan Quipperian yang ingin berkuliah di Negeri Serambi Mekkah.', '2021-06-17 01:27:09', '2021-06-17 01:27:09'),
(319, 'Sekolah Tinggi Ilmu Ekonomi Sabang (STIES) Banda Aceh', 2, 'admin@stiesb-aceh.ac.id', 'https://www.sties-aceh.ac.id', 'Jalan Prada Utama No 15 Lam Gugop Kota Banda Aceh', '065132432', 'Quipperian ingin menekuni rumpun ilmu ekonomi? Sekolah Tinggi Ilmu Ekonomi Sabang (STIES) Banda Aceh bisa jadi salah satu pilihan. Sekolah tinggi ini telah berdiri sejak tahun 1986 dan telah meraih akreditasi B untuk setiap program studinya. Sejak berdiri hingga kini, STIES telah menghasilakn ribuan lulusan sarjana ekonomi yang berkontribusi di berbagai unit organisasi pemerintahan, swasta, maupun dalam kehidupan masyarakat.', '2021-06-17 01:32:02', '2021-06-17 01:32:02'),
(320, 'Universitas Almuslim', 2, 'almuslim.universitas@yahoo.co.id', 'https://www.umuslim.ac.id', 'Jl. Tengku Abdurrahman No 37 Matangglumpangdua Bireuen, Aceh', '064441126', 'Tahukah Quipperian bahwa Universitas Almuslim merupakan satu-satunya Universitas di Kabupaten Bireuen, Aceh? Tak hanya itu, berdasarkan SK Menteri Pendidikan Nasional Republik Indonesia Nomor 02/D/O/2003, beberapa sekolah tinggi lain juga bergabung menjadi bagian dari Universitas Almuslim. Sekolah tersebut antara lain Sekolah Tinggi Ilmu Pertanian (STP), Sekolah Tinggi Keguruan dan Ilmu Pendidikan (STKIP), dan Akademi Manajemen Informatika dan Komputer (AMIK). Wah, makin lengkap dong jurusannya!', '2021-06-18 08:29:15', '2021-06-18 01:29:15');
